import "./MovieAddForm.css";

const MovieAddForm = () => {
  return (
    <div className="movie-add-form">
      <h3>Yangi kino qo'shish</h3>
      <form className="add-form d-flex">
        <input
          type="text"
          className="form-control new-post-label"
          placeholder=""
        />
      </form>
    </div>
  );
};

export default MovieAddForm;
